# Run the isql command and capture its output\nisql -S$server -D$database -U$userID -P$password << EOF > output.txt\nexec MY_STORED_PROC\ngo\nEOF\n\n# Extract the return status using grep and sed\nreturn_status=$(grep "return status" output.txt | sed -e 's/.*= //')\n\n# Print the extracted status\necho "Return status: $return_status"\n\n# You can now use the return_status variable as needed